import { BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

import Giphy from "./Giphy";
import Reddit from "./Reddit";

function App() {
  return (
    <div >
      <Reddit></Reddit>

      <Switch>
        <Route path="/reddit">
            <Reddit />
        </Route>
        <Route path="/giphy">
            <Giphy />
        </Route>
      </Switch>

    </div>


  );
}

export default App;
